var x_pos;
var y_pos;

function draw(x, y)
{
    
    if (canvas_draw.getContext)
    {
        var ctx = canvas_draw.getContext('2d');
        //drawing code here
        ctx.lineWidth = 1;
        ctx.fillStyle = "#FF0000";
        ctx.strokeRect (x, y, 16, 16);
    } 
    else 
    {
        // canvas-unsupported code here
    }
}
var count = 0;
var listOfCheckBoxes = ["cbQ", "cbW", "cbE", "cbA", "cbS", "cbD", "cbZ", "cbX", "cbC"]
document.onkeydown = function(event)
{     
    //num = num + 1;
    var tiles = mydata['output']['tiles'];  
    var positions = mydata['output']['tiles'];
    switch (event.keyCode)
    {
        //enter
        case 13:
            //prints which affordances have been checked off to console
            var affordancesChecked = ""
            for (i = 0; i < listOfCheckBoxes.length; i++){
                if (document.getElementById(listOfCheckBoxes[i]).checked){
                    affordancesChecked += String(listOfCheckBoxes[i])
                }
            }
            console.log(affordancesChecked)

            //alert('test'); //remove if needed
            for (i = 0; i < 10; i++){
                draw(0, 0);//here draw all the squares around tiles
                tile.src = tiles['tile_' + num]['tile_data'];
            };
            if (num == (Object.keys(tiles).length - 1))
            {
                alert('Out of tiles. Last tile num = ' + num);   
                break;         
            }
            else
            {
                num = num + 1;
            }
            break;
        //q
         case 81:
            checkBoxes("cbQ");
            break;
        //w
        case 87:
            checkBoxes("cbW");
            break;
        //e
        case 69:
            checkBoxes("cbE");
            break;
        //a
        case 65: 
            checkBoxes("cbA");
            break;
        //s
        case 83:
            checkBoxes("cbS");
            break;
        //d
        case 68:
            checkBoxes("cbD");
            break;
        //z
        case 90:
            checkBoxes("cbZ");
            break;
        //x
        case 88:
            checkBoxes("cbX");
            break;
        //c
        case 67:
            checkBoxes("cbC");
            break;
    }
}

function checkBoxes(checkBoxID){
    var box = document.getElementById(checkBoxID);
    
    if (box.checked){
        box.checked = false;
    }
    else{
        box.checked = true;
    }
}